$accentColor: #ff4400;
$secondaryColor: #444;
$primaryColorDark: #293146;
$primaryColor: #f2f2f2;
$secondaryColorLight: #fdfdfd;

// :root {
//   line-height: 1.4;
//   font-size: 16px;
//   padding: 0;
//   margin: 0;
//   box-sizing: border-box;
// }

* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
  font-family: poppins;
}

body {
  font-size: 1rem;
  width: 100vw;
  overflow-x: hidden;
  background: $primaryColor;
  color: $secondaryColor;
  transition: background 600ms ease-out;
}

.dark {
  background: $primaryColorDark;
  color: $secondaryColorLight;
}
.content {
  padding-top: 80px;
  width: 80%;
  margin: auto;
}
section {
}

section h2 {
  font-size: 2rem;
  color: $accentColor;
}

.nav {
  position: fixed;
  top: 0;
  background: linear-gradient(#ff895e, #ff7644);
  display: flex;
  align-items: center;
  justify-content: space-around;
  height: 50px;
  width: 100vw;
  .logo {
    flex: 1;
  }
  .logo h1 {
    font-size: 2.5rem;
    font-weight: 400;
    color: $accentColor;
    pointer-events: none;
  }
  .logo-container {
    display: block;
    margin-left: 2rem;
    background-color: $primaryColor;
    width: 3rem;
    height: 3rem;
    display: flex;
    align-items: center;
    justify-content: space-around;
    border-radius: 50%;
  }
  & ul {
    display: flex;
    align-items: center;
    height: 100%;
    justify-content: space-between;
    margin-right: 2rem;
    .nav-items {
      position: relative;
      margin-left: 1rem;
      // height: ;
      // border-radius: 3px;
      list-style: none;
    }
  }
  & p {
    color: #cecece;
    margin-right: 1rem;
  }
  a {
    text-align: center;
    display: inline-block;
    height: 100%;
    text-decoration: none;
    position: relative;
    color: #fefefe;
  }
}
.dropdown {
  font-size: 1rem;
  color: #fefefe;
  margin-left: 1rem;
  transition: transform 400ms ease-in-out;
  &.dropped {
    transform: rotate(90deg);
  }
}
.sub-services {
  position: absolute;
  display: block;
  width: auto;
  padding: 10px;
  background-color: $accentColor;
  border-bottom-left-radius: 12px;
  border-bottom-right-radius: 12px;
}

.hidden {
  display: none;
}
.active {
  border: 1px solid $accentColor;
  color: #fff;
  margin: 1rem;
  background-color: red;
}
footer {
  height: 40rem;
  nav {
    margin: auto;
  }
  .toggle {
    width: 3.2rem;
    height: 1.7rem;
    border-radius: 500px;
    background-color: $primaryColor;
    margin: 0;
    display: flex;
    align-items: center;
    position: relative;

    .togglebtn {
      position: absolute;
      left: 2px;
      height: 1.3rem;
      width: 1.3rem;
      background-color: $accentColor;
      border-radius: 50%;
      transition: transform 800ms ease-in-out;
    }
    &.active {
      background-color: $primaryColorDark;
      & .togglebtn {
        left: auto;
        right: 2px;
      }
    }
  }
}
